labels:
  dupe: outline
  stroke: none
  fill: black
  font-style: italic
  font-family: Arial, Helvetica, sans-serif
  outline:
    stroke: white
    fill: none
    stroke-width: 0.25
    stroke-opacity: 0.75
  contours-10m:
    fill: "#805100"
    font-size: 1.4
    letter-spacing: 0.05
    format: "%d"
    orientation: uphill
    collate: true
    deviation: 0.075
    minimum-length: 30
    separation-all: 15
    separation-along: 100
    separation: 40
  watercourses:
    fill: "#1667DF"
    letter-spacing: 0.1
    word-spacing: 2.0
    font-size: 1.4
    collate: true
    densify: 10
    simplify: 2.0
    buffer: 3.0
    smooth: [ 20, 90 ]
    separation: 80
    deviation: 4.0
  watercourses M:
    font-size: 1.4
  watercourses L:
    font-size: 1.6
    separation: 120
  watercourses H:
    font-size: 1.8
    separation: 120
  waterfalls:
    position: [ right, above, below, left, aboveright, belowright, aboveleft, belowleft ]
    margin: 1.0
    font-size: 1.3
    fill: "#1667DF"
    collate: true
    separation: 20
  roads:
    font-size: 1.4
    letter-spacing: 0.1
    collate: true
    densify: 5.0
    simplify: 2.0
    buffer: 2.0
    smooth: [ 15, 60 ]
    separation: 100
    deviation: 3.0
  [ roads Walking-Track, roads Bicycle-Track, roads 2wd, roads 4wd ]:
    font-size: 1.4
    buffer: 1.7
  [ roads Sub-Arterial, roads Collector ]:
    font-size: 1.6
  [ roads Freeway, roads Highway, roads Arterial ]:
    font-size: 1.8
    word-spacing: 1.0
  spot-heights:
    format: "%d"
    font-size: 1.4
    margin: 0.7
    position: [ right, above, below, left, aboveright, belowright, aboveleft, belowleft ]
  place-names:
    position: [ over, right, above, below, left ]
    font-size: 1.6
    margin: 0.7
    letter-spacing: 0.2
  feature-names:
    font-family: Calibri, Arial, Helvetica, sans-serif
    font-style: normal
    font-size: 1.8
    margin: 0.7
    letter-spacing: 0.1
    position: [ over, right, above, below, left ]


